width: 250px;
height: 350px;
background: #2e517d;
position: relative;
left: 50%;
top: 50%;
transform: translate(-50%,-50%);
perspective: 1000px;

&:hover{
    transform: rotateY('-180');
}
`;

const Cover=styled.div`
width: 210px;
height: 100%;
position: absolute;
left: 40px;
background-color: #345b8c;
transform: rotateY('0deg');
transform-style: preserve-3d;
transform-origin: left;
transition: ;

`;
const FoldingCard = () => {
    return (
        <MainContainer>
               <Container>
           <Cover>

           </Cover>
       </Container>
        </MainContainer>
          
      
    )
}

export default FoldingCard
